           ticklen : 5,

           },
        },

        },

           {

           },
           {

              font : {
                 family: 'Arial',
                 size : 22,
                 color : 'rgb(150,150,150)'
              }
           }
        ]
      };
      for (var i = 0; i < xData.length; i++) {
        var result = {
        xref: 'paper',

        text : yData[i][0],
        xanchor : 'right',

        showarrow : false,

        };
        var result2 = {

           clicktoshow  : 'onout'
        };
        layout.annotations.push(result, result2);
      }
      var config = {responsive: true,
                    displaylogo: false};
      Plotly.newPlot('Fluid Pressure', data, layout, config);
